#include <iostream>

void check_age(int age) {
    if (age < 0) {
        std::cout << "Invalid age" << std::endl;
    } else if (age < 13) {
        std::cout << "Child" << std::endl;
    } else if (age < 20) {
        std::cout << "Teenager" << std::endl;
    } else if (age < 65) {
        std::cout << "Adult" << std::endl;
    } else {
        std::cout << "Senior" << std::endl;
    }
}

void check_access(bool logged_in, bool is_admin) {
    if (logged_in && is_admin) {
        std::cout << "Full access" << std::endl;
    } else if (logged_in && !is_admin) {
        std::cout << "Limited access" << std::endl;
    } else {
        std::cout << "No access" << std::endl;
    }
}

int main() {
    check_age(8);
    check_age(16);
    check_age(35);
    check_age(70);

    std::cout << "---" << std::endl;

    check_access(true, true);
    check_access(true, false);
    check_access(false, false);

    return 0;
}

