#include <iostream>

int add(int a, int b) {
    return a + b;
}

int multiply(int a, int b) {
    return a * b;
}

int square(int x) {
    return x * x;
}

int factorial(int n) {
    if (n <= 1) {
        return 1;
    }
    return n * factorial(n - 1);
}

int main() {
    std::cout << "2 + 3 =" << std::endl;
    std::cout << add(2, 3) << std::endl;
    std::cout << "4 * 5 =" << std::endl;
    std::cout << multiply(4, 5) << std::endl;
    std::cout << "7 squared =" << std::endl;
    std::cout << square(7) << std::endl;
    std::cout << "5! =" << std::endl;
    std::cout << factorial(5) << std::endl;
    return 0;
}

