#include <iostream>

int fib(int n) {
    if (n <= 1) {
        return n;
    }
    return fib(n - 1) + fib(n - 2);
}

int main() {
    std::cout << "Fibonacci sequence:" << std::endl;
    for (int i = 0; i < 10; i++) {
        std::cout << fib(i) << std::endl;
    }
    return 0;
}

